//nolint:revive,govet,errcheck
package common

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_SPEED_TYPE(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e SPEED_TYPE
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := SPEED_TYPE_AIRSPEED.MarshalText()
		require.NoError(t, err)

		var dec SPEED_TYPE
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, SPEED_TYPE_AIRSPEED, dec)
	})
}
